import React from "react";
import Square from "./Square";

const style = {
  border: "4px solid #392836",
  borderRadius: "10px",
  width: "120px",
  height: "120px",
  margin: "0 auto",
  display: "grid",
  gridTemplate: "repeat(3,1fr) / repeat(3,1fr)"
};

function Board({ squares, onClick }) {
  return (
    <div style={style}>
      <Square value="1" onClick={() => onClick("no value yet")} />
