      <Square value="6" onClick={() => onClick("no value yet")} />
      <Square value="7" onClick={() => onClick("no value yet")} />
      <Square value="8" onClick={() => onClick("no value yet")} />
      <Square value="9" onClick={() => onClick("no value yet")} />
    </div>
  );
}
export default Board;
